(1, 'NEWTEL AM Tablet 10s', 'Amlodipine Besylate 5mg + Telmisartan 40mg', 'Used to treat high blood pressure, chest pain due to narrowing of the blood vessels of the heart muscle (angina pectoris) ', '1. Swelling of eyelids, face or lips \r\n\r\n2. Sudden wheeziness, chest pain, shortness of breath or difficulty in breathing \r\n\r\n3. Swelling of the tongue and throat which causes great difficulty breathing \r\n\r\n4. Abnormal heart beat \r\n\r\n5. Severe abdominal and back pain', '1. Always take this medicine exactly as your doctor has told you \r\n\r\n2.Do not take NEWTEL AM with grapefruit juice. \r\n\r\n3. Take one time each day at the same time.\r\n\r\n4. Take this medicine with or without food.', 45, , 1);
