(2, 'STARCAD T 25mg Tablet 10s', '10\'s\r\nS Metoprolol 25mg + Telmisartan 40mg\r\n\r\n', 'Used for the treatment of hypertension.', '1. Dry mouth \r\n\r\n2. Irritability \r\n\r\n3. FAtigue \r\n\r\n4. Trouble sleeping \r\n\r\n5.. Back pain \r\n\r\n6.Headache \r\n\r\n7.. Fever', '1.The dosage and the drug form depend on the age, weight and medical condition of an individual. Take STARCAD T 25mg Tablet as prescribed by your doctor. \r\n\r\n2.Swallow the tablet whole. Do not crush or chew the tablet. Take the drug with or without food. However, taking the drug with food prevents stomach upset.', 130, , 2);
