(3, 'A CN Gel(Topical) 20gm', 'Clindamycin 1% + Nicotinamide 4%', 'It is used to treat mild to moderate acne (spots).', '1. Talk to your doctor before using it, if you: Are allergic (hypersensitive) to the active substance Clindamycin phosphate, Nicotinamide or any of the other ingredients.\r\n\r\n2. If you are pregnant or breast-feeding, think you may be pregnant or planning to have baby, ask your doctor for advice before taking this medicine.\r\n\r\n3. A CN should not be used by children under the age of 12 years', '1. Always apply this medicine exactly as your doctor has told you. \r\n\r\n2. It is intended for use on the skin. \r\n\r\n3. You should use A CN once a day. Wash as normal, rinse well and pat your skin dry. \r\n\r\n4. Apply a small amount of medicine in a thin layer to the whole of the area where you usually get the spots. \r\n\r\n5. It is important to replace the cap after you have used A CN.', 122, , 1);
