(8, 'AROMASIN 25mg Tablet 15s', 'Exemestane 25mg', 'To treat hormone dependent in early breast cancer in postmenopausal women after they have completed 2-3 years of treatment with the medicine', '1. Do not drive or operate machines if you feel drowsy, dizzy or weak while taking this medicine\r\n\r\n2. AROMASIN 25MG is not recommended for use in children and adolescents \r\n\r\n3. Do not take AROMASIN 25MG if you are pregnant or breast-feeding \r\n\r\n4.Talk to your doctor before taking this medicine, if you are allergic to exemestane or any of the other ingredients of this medicine ', '1. Always take this medicine exactly as your doctor has told you. \r\n\r\n2. AROMASIN 25MG should be taken by mouth after a meal at approximately the same time each day. \r\n\r\n3. The recommended dose is one 25 mg tablet daily. ', 5284, , NULL);
